import{_ as i}from"./plugin-vue_export-helper-c27b6911.js";import{o as l,c as e,e as a}from"./app-5d92246e.js";const s={},t=a('<h1 id="线性表" tabindex="-1"><a class="header-anchor" href="#线性表" aria-hidden="true">#</a> 线性表</h1><h2 id="基本定义" tabindex="-1"><a class="header-anchor" href="#基本定义" aria-hidden="true">#</a> 基本定义</h2><p>线性表是具有相同数据结构的n(n ≥ 0)个数据元素的有限序列，其中n为表长，为0即为空表。一般标识为：L=(a<sub>1</sub>,a<sub>2</sub>,a<sub>3</sub>,a<sub>i</sub>,a<sub>i+1</sub>,……,a<sub>n</sub>,)，其中a<sub>1</sub>是唯一的第一个元素，被称为表头元素；a<sub>n</sub>是唯一一个最后一个元素，被称为表尾元素。除了第一个元素外，每个元素有且仅有一个直接前驱，除最后一个外，每个元素有且仅有一个直接后继，这种线性有序的表被称为线性表。线性表有以下特点：</p><ul><li>表中元素个数有限。</li><li>表中元素具有逻辑上的顺序性，表中元素有先后顺序。</li><li>表中元素都是数据结构，每个元素都是单个结构。</li><li>表中的元素类型数据都相同，这意味着每个元素所占相同大小的空间。</li><li>表中的元素具有抽象性。</li></ul><h2 id="基本操作" tabindex="-1"><a class="header-anchor" href="#基本操作" aria-hidden="true">#</a> 基本操作</h2><ul><li>initList：初始化表，构造一个空的线性表。</li><li>length：求表长，返回线性表的长度即其中的元素个数。</li><li>locationElem：按值查找元素。</li><li>getElem：按位查找元素。</li><li>listInsert：插入操作。</li><li>listDelete：删除操作。</li><li>printList：输出操作。</li><li>empty：判空操作。</li><li>destoryList：销毁操作。</li></ul>',6),n=[t];function r(u,c){return l(),e("div",null,n)}const d=i(s,[["render",r],["__file","linear-list.html.vue"]]);export{d as default};
